import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

const Wrapper = styled.div`
  background: linear-gradient(to right, #414345, #232526);
  display: flex;
  justify-content: space-between;
  align-items: center;
  box-shadow: 0 30px 60px 0 rgba(0, 0, 0, 0.2);
  border-radius: 20px;
`;

const Logo = styled.div`
  padding: 0px 0px 0px 50px;
  color: gray;
  font-family: "Bungee Inline", cursive;
`;

const Title = styled.h1`
  font-size: 70px;
`;

const Nav = styled.nav`
  display: flex;
`;

const NavLinks = styled.a`
  text-decoration: none;
  color: gray;
  padding: 0px 50px 0px 0px;
  font-weight: 500;
  font-family: "Bungee Inline", cursive;
`;

export default Header => {
  return (
    <Wrapper className="nav-container">
      <Logo>
        <Title>LA Opt</Title>
      </Logo>
      <Nav className="nav-bar">
        <NavLinks href="https://dreamy-goldberg-0edc2e.netlify.com/">
          Home
        </NavLinks>
        <NavLinks href="https://la-opt.netlify.com/">About</NavLinks>
        <Link to="/login">
          <NavLinks href="#">Login</NavLinks>
        </Link>
        <Link to="/signup">
          <NavLinks href="#">Signup</NavLinks>
        </Link>
      </Nav>
    </Wrapper>
  );
};
